1. H5 Mall1.1. Introduction1.2. Integrate1.3. Service Protocol1.3.1. Service Provided By BizBundle1.3.2. Service Required By BizBundle1.4. User Guidance1.4.1. Precautions1.4.2. Check mall availability1.4.3. Get mall page (UIViewController)1. H5 Mall
1.1. Introduction
H5 Mall provides an container that hosts the "App mall", so that your app has powerful mall capabilities and allows mobile traffic to be realized through the mall.

"App mall" is a value-added service provided by Tuya platform. For details, you can serach "App mall" in Tuya Smart Platform Value-added Service

1.2. Integrate
Add the TuyaSmartMallBizBundle in the project's Podfile file and execute thepod update command
source "https://github.com/TuyaInc/TuyaPublicSpecs.git"
source 'https://cdn.cocoapods.org/'

target 'your_target_name' do
  # TuyaSmart SDK
  pod "TuyaSmartHomeKit"
  # Add H5 Mall BizBundle
  pod 'TuyaSmartMallBizBundle', '~> 3.20.0'
end

1.3. Service Protocol
1.3.1. Service Provided By BizBundle
The H5 mall BizBundle implements the TYMallProtocol protocol to provide services. View theTYMallProtocol.h file in the TYModuleServices as follows:
#import 

typedef NS_ENUM(NSUInteger, TYMallPageType) {
    TYMallPageTypeHome,      // Mall home page
    TYMallPageTypeOrders,    // Mall orders page
};

@protocol TYMallProtocol 

/**
 * Check if mall enable for current logged user.
 * You should check this every time after logged user changed.
 */
- (void)checkIfMallEnableForCurrentUser:(void(^)(BOOL enable, NSError *error))callback;

/**
 * Request special mall page with `TYMallPageType`
 * You should replace mall page every time after logged user changed.
 * @param pageType Mall page type
 */
- (void)requestMallPage:(TYMallPageType)pageType completionBlock:(void(^)(__kindof UIViewController *page, NSError *error))callback;

@end

1.3.2. Service Required By BizBundle
None.
1.4. User Guidance
1.4.1. Precautions

Before using any method, be sure to confirm that the user is logged in.
Before obtaining any mall page, you need to first confirm whether the service area registered by the current user is open for the mall.
When the login user changes, be sure to re-judge the mall availability status and re-acquire the mall page
Get the mall page as UIViewController, be sure to useUINavigationController to push orpresent it.


The mall page depends on the navigation controller and sets the navigation bar content.

1.4.2. Check mall availability
